const generateMainGoalsText = (formData) => {
    const mainGoals = Object.entries(formData.goals.mainGoals)
        .filter(([, value]) => value === true)
        .map(([key]) => key);
    const mainGoalsText = mainGoals.map((text) => text.replaceAll('-', ' ')).join(', ');
    if (mainGoals.includes('other')) {
        mainGoalsText.concat(`, ${formData.goals.otherGoalsDescription}`);
    }
    return mainGoalsText;
};

const generateDaysOfWeekText = (formData) =>
    Object.entries(formData.lifestyle.trainingDays)
        .filter(([, value]) => value === true)
        .map(([key]) => key)
        .map(capitalizeWord)
        .join(', ');

const generateEquipmentText = (formData) =>
    Object.entries(formData.equipment)
        .filter(([, value]) => value === true)
        .map(([key]) => key)
        .map(separateCamelCase)
        .map(toLowerCaseAll)
        .join(', ');

const capitalizeWord = (word) => word.replace(/\b\w/g, (char) => char.toUpperCase());

const separateCamelCase = (word) => word.replace(/([A-Z])/g, ' $1').trim();

const toLowerCaseAll = (word) => word.replace(/[A-Z]/g, (char) => char.toLowerCase());

module.exports = createPrompt;
